import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import axios from 'axios';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Inicio</Link></li>
            <li><Link to="/agregar-viaje">Agregar Viaje</Link></li>
            <li><Link to="/consultar-viajes">Consultar Viajes</Link></li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact component={Inicio} />
          <Route path="/agregar-viaje" component={AgregarViaje} />
          <Route path="/consultar-viajes" component={ConsultarViajes} />
          <Route path="/modificar-viaje/:id" component={ModificarViaje} />
        </Switch>
      </div>
    </Router>
  );
};

const Inicio = () => <h2>Bienvenido a la aplicación de gestión de viajes</h2>;

const AgregarViaje = () => {
  const [viaje, setViaje] = useState({
    pais: '',
    ano: '',
    mes: '',
    duracion: '',
    costo: '',
    kmRecorrido: ''
  });

  const handleChange = (e) => {
    setViaje({
      ...viaje,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:3003/agregar-viaje', viaje)
      .then(response => {
        alert('Viaje agregado');
      })
      .catch(error => {
        console.error('Error al agregar viaje:', error);
      });
  };

  return (
    <div>
      <h2>Agregar Viaje</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="pais" value={viaje.pais} onChange={handleChange} placeholder="Pais" required />
        <input type="number" name="ano" value={viaje.ano} onChange={handleChange} placeholder="Año" required />
        <input type="number" name="mes" value={viaje.mes} onChange={handleChange} placeholder="Mes" required />
        <input type="number" name="duracion" value={viaje.duracion} onChange={handleChange} placeholder="Duración (días)" required />
        <input type="number" name="costo" value={viaje.costo} onChange={handleChange} placeholder="Costo" required />
        <input type="number" name="kmRecorrido" value={viaje.kmRecorrido} onChange={handleChange} placeholder="Kilómetros recorridos" required />
        <button type="submit">Agregar</button>
      </form>
    </div>
  );
};

const ConsultarViajes = () => {
  const [viajes, setViajes] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:3003/consultar-viajes')
      .then(response => {
        setViajes(response.data);
      })
      .catch(error => {
        console.error('Error al obtener los viajes:', error);
      });
  }, []);

  const eliminarViaje = (id) => {
    axios.delete(`http://localhost:3003/eliminar-viaje/${id}`)
      .then(response => {
        setViajes(viajes.filter(viaje => viaje.id !== id));
      })
      .catch(error => {
        console.error('Error al eliminar el viaje:', error);
      });
  };

  return (
    <div>
      <h2>Consultar Viajes</h2>
      <table>
        <thead>
          <tr>
            <th>Pais</th>
            <th>Año</th>
            <th>Mes</th>
            <th>Duración</th>
            <th>Costo</th>
            <th>Km Recorridos</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {viajes.map(viaje => (
            <tr key={viaje.id}>
              <td>{viaje.pais}</td>
              <td>{viaje.ano}</td>
              <td>{viaje.mes}</td>
              <td>{viaje.duracion}</td>
              <td>{viaje.costo}</td>
              <td>{viaje.kmRecorrido}</td>
              <td>
                <button onClick={() => eliminarViaje(viaje.id)}>Eliminar</button>
                <Link to={`/modificar-viaje/${viaje.id}`}><button>Modificar</button></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const ModificarViaje = ({ match }) => {
  const [viaje, setViaje] = useState({
    pais: '',
    ano: '',
    mes: '',
    duracion: '',
    costo: '',
    kmRecorrido: ''
  });

  useEffect(() => {
    axios.get(`http://localhost:3003/consultar-viaje/${match.params.id}`)
      .then(response => {
        setViaje(response.data);
      })
      .catch(error => {
        console.error('Error al obtener el viaje:', error);
      });
  }, [match.params.id]);

  const handleChange = (e) => {
    setViaje({
      ...viaje,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.put(`http://localhost:3003/modificar-viaje/${match.params.id}`, viaje)
      .then(response => {
        alert('Viaje modificado');
      })
      .catch(error => {
        console.error('Error al modificar el viaje:', error);
      });
  };

  return (
    <div>
      <h2>Modificar Viaje</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="pais" value={viaje.pais} onChange={handleChange} placeholder="Pais" required />
        <input type="number" name="ano" value={viaje.ano} onChange={handleChange} placeholder="Año" required />
        <input type="number" name="mes" value={viaje.mes} onChange={handleChange} placeholder="Mes" required />
        <input type="number" name="duracion" value={viaje.duracion} onChange={handleChange} placeholder="Duración (días)" required />
        <input type="number" name="costo" value={viaje.costo} onChange={handleChange} placeholder="Costo" required />
        <input type="number" name="kmRecorrido" value={viaje.kmRecorrido} onChange={handleChange} placeholder="Kilómetros recorridos" required />
        <button type="submit">Modificar</button>
      </form>
    </div>
  );
};

export default App;
